import React from "react";
import {Route, Switch} from "react-router-dom";

import {Spin} from 'antd'
const App = ({match}) => (
  <div className="gx-main-content-wrapper">
    <Switch>
      <Route path={`${match.url}main`} component={Spin}/>
    </Switch>
  </div>
);

export default App;
